const {
  ApolloServer
} = require("apollo-server");
const dotenv = require("dotenv");
const mongoose = require("mongoose");
const typeDefs = require("./typeDefs");
const resolvers = require("./resolvers");
dotenv.config();

// Database
const db = {
  host: process.env.DB_HOST,
  user: process.env.DB_USER,
  pass: process.env.DB_PASS,
  name: process.env.DB_NAME
};
const dbUri = `mongodb+srv://${db.user}:${db.pass}@${db.host}/${db.name}?retryWrites=true&w=majority`;
const dbOptions = {
  useNewUrlParser: true,
  useUnifiedTopology: true
};
mongoose.connect(dbUri, dbOptions).then(() => console.log("Database connected")).catch(error => console.log("Databased failed: ", error));

// GraphQL
const server = new ApolloServer({
  typeDefs,
  resolvers
});
server.listen(process.env.PORT).then(({
  url
}) => console.log(`Server ready at ${url}`)).catch(error => console.log("Server failed: ", error));
